CREATE TABLE `dependency` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `condi` varchar(100) DEFAULT NULL,
  `status` int(2) NOT NULL DEFAULT '0',
  `insertToken` varchar(600) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=453 DEFAULT CHARSET=latin1
;

CREATE TABLE `dependencycolumn` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dependencyId` int(11) DEFAULT NULL,
  `columnName` varchar(1024) DEFAULT NULL,
  `isDeterminantColumn` tinyint(1) DEFAULT NULL,
  `value` text,
  PRIMARY KEY (`id`),
  KEY `dependencyId` (`dependencyId`)
) ENGINE=InnoDB AUTO_INCREMENT=991 DEFAULT CHARSET=latin1
;

CREATE TABLE `exception` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `Message` varchar(200) DEFAULT NULL,
  `AppID` bigint(20) DEFAULT NULL,
  `CrossAppException` int(11) DEFAULT NULL,
  `OperatingSystemException` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=11193 DEFAULT CHARSET=latin1
;

